import React from 'react';

import './weatherScreen.css';

const WeatherScreen = ({ infoToExport }) => {
    if (!infoToExport) {
        return null;
    }

    const { temp, feelsLike, humidity, wind, icon} = infoToExport;

    <div id="weather">
    <img src="" alt="" id="icon" />
    <h1 className="degree">{temp}&deg;C</h1>
    <h2 id="city">Stockholm</h2>
    <button id="change">Change City</button>

    <div className="info">

        <div>
            <h3>Wind</h3>
            <div id="windValue" classname="value"><p>2</p><span>Km/h</span></div>
        </div>
        <div>
            <h3>Feels Like</h3>
            <div id="feelsLikeValue" classname="value"><p>2</p><span>Km/h</span></div>
        </div>
        <div>
            <h3>Humidity</h3>
            <div id="humidityValue" classname="value"><p>2</p><span>Km/h</span></div>
        </div>

    </div>

    </div>
};


export default WeatherScreen;
